module.exports = "<section id=\"alert\">\r\n    <div class=\"row match-height text-left\">\r\n        <div class=\"col-sm-12\">\r\n            <div class=\"content-header\">Alerts</div>\r\n            <p class=\"content-sub-header\">Provide contextual feedback messages for typical user actions with the handful of available and flexible alert messages.</p>\r\n        </div>\r\n    </div>\r\n    <!--Alert States Starts-->\r\n    <div class=\"row match-height text-left\">\r\n        <div class=\"col-md-12\">\r\n            <div class=\"card\">\r\n                <div class=\"card-header\">\r\n                    <h4 class=\"card-title\">Alert States</h4>\r\n                    <p>Wrap any text and an optional dismiss button in <code>.alert</code> and one of the four contextual classes (e.g., <code>.alert-COLOR</code>) for basic colored alert messages.</p>\r\n                </div>\r\n                <div class=\"card-content\">\r\n                    <div class=\"card-body\">\r\n                        <ngb-alert type=\"primary\" [dismissible]=\"false\">\r\n                            <strong>Primary!</strong> Better check yourself, you're not looking too good.\r\n                        </ngb-alert>\r\n                        <ngb-alert type=\"secondary\" [dismissible]=\"false\">\r\n                            <strong>Secondary!</strong> Better check yourself, you're not looking too good.\r\n                        </ngb-alert>\r\n                        <ngb-alert type=\"success\" [dismissible]=\"false\">\r\n                            <strong>Success!</strong> Better check yourself, you're not looking too good.\r\n                        </ngb-alert>\r\n                        <ngb-alert type=\"danger\" [dismissible]=\"false\">\r\n                            <strong>Danger!</strong> Better check yourself, you're not looking too good.\r\n                        </ngb-alert>\r\n                        <ngb-alert type=\"info\" [dismissible]=\"false\">\r\n                            <strong>Info!</strong> Better check yourself, you're not looking too good.\r\n                        </ngb-alert>\r\n                        <ngb-alert [dismissible]=\"false\">\r\n                            <strong>Warning!</strong> Better check yourself, you're not looking too good.\r\n                        </ngb-alert>\r\n                        <ngb-alert type=\"light\" [dismissible]=\"false\">\r\n                            <strong>Light!</strong> Better check yourself, you're not looking too good.\r\n                        </ngb-alert>\r\n                        <ngb-alert type=\"dark\" [dismissible]=\"false\">\r\n                            <strong>Dark!</strong> Better check yourself, you're not looking too good.\r\n                        </ngb-alert>\r\n                    </div>\r\n                </div>\r\n            </div>\r\n        </div>\r\n    </div>\r\n    <!--Alert States Ends-->\r\n    \r\n    <!--Closable Alert Starts-->\r\n    <div class=\"row match-height text-left\">\r\n        <div class=\"col-md-12\">\r\n            <div class=\"card\">\r\n                <div class=\"card-header\">\r\n                    <h4 class=\"card-title\">Closable Alert</h4>\r\n                    <p></p>\r\n                </div>\r\n                <div class=\"card-content\">\r\n                    <div class=\"card-body\">\r\n                        <div *ngFor=\"let alert of alerts\">\r\n                            <ngb-alert [type]=\"alert.type\" (close)=\"closeAlert(alert)\">{{ alert.message }}</ngb-alert>\r\n                        </div>\r\n                        <p>\r\n                            <button type=\"button\" class=\"btn btn-primary btn-raised\" (click)=\"reset()\">Reset</button>\r\n                        </p>\r\n                    </div>\r\n                </div>\r\n            </div>\r\n        </div>\r\n    </div>\r\n    <!--Closable Alert Ends-->\r\n    \r\n    <!--Self-Closing Alert Section starts-->\r\n    <div class=\"row match-height text-left\">\r\n        <div class=\"col-md-12\">\r\n            <div class=\"card\">\r\n                <div class=\"card-header\">\r\n                    <h4 class=\"card-title\">Self-Closing Alert</h4>\r\n                    <p>Static self-closing alert that disappears after 20 seconds (refresh the page if it has already disappeared)</p>\r\n                </div>\r\n                <div class=\"card-content\">\r\n                    <div class=\"card-body\">\r\n                        <ngb-alert *ngIf=\"!staticAlertClosed\" (close)=\"staticAlertClosed = true\">Check out our awesome new features!</ngb-alert>\r\n\r\n                        <hr/>\r\n\r\n                        <p>Show a self-closing success message that disappears after 5 seconds.</p>\r\n                        <ngb-alert *ngIf=\"successMessage\" type=\"success\" (close)=\"successMessage = null\">{{ successMessage }}</ngb-alert>\r\n                        <p>\r\n                            <button class=\"btn btn-primary btn-raised\" (click)=\"changeSuccessMessage()\">Change message</button>\r\n                        </p>\r\n                    </div>\r\n                </div>\r\n            </div>\r\n        </div>\r\n    </div>\r\n    <!--Self-Closing Alert Section Ends-->\r\n    \r\n    <!--Custom Alert Starts-->\r\n    <div class=\"row match-height text-left\">\r\n        <div class=\"col-md-12\">\r\n            <div class=\"card\">\r\n                <div class=\"card-header\">\r\n                    <h4 class=\"card-title\">Custom Alert</h4>\r\n                </div>\r\n                <div class=\"card-content\">\r\n                    <div class=\"card-body\">\r\n                        <p>\r\n                            <ngb-alert type=\"custom\" [dismissible]=\"false\"><strong>Whoa!</strong> This is a custom alert.</ngb-alert>\r\n                        </p>\r\n                    </div>\r\n                </div>\r\n            </div>\r\n        </div>\r\n    </div>\r\n    <!--Custom Alert Ends-->    \r\n</section>"

