module.exports = "<section id=\"ng-buttons\">\r\n    <div class=\"row text-left\">\r\n        <div class=\"col-sm-12 mt-2\">\r\n            <div class=\"content-header\">Ngb-Buttons</div>\r\n            <p class=\"content-sub-header\">Easily create Bootstrap-style checkbox buttons. A value of a checked button is bound to a variable specified\r\n                via <code>ngModel</code>.</p>\r\n        </div>\r\n    </div>\r\n    <div class=\"row text-left\" matchHeight =\"card\">\r\n        <!--Checkbox ng-buttons Starts-->\r\n        <div class=\"col-md-12 col-lg-6\">\r\n            <div class=\"card\">\r\n                <div class=\"card-header\">\r\n                    <h4 class=\"card-title\">Checkbox buttons</h4>\r\n                    <p>Easily create Bootstrap-style checkbox buttons.</p>\r\n                </div>\r\n                <div class=\"card-content\">\r\n                    <div class=\"card-body\">\r\n                        <div class=\"btn-group btn-group-toggle\">\r\n                            <label class=\"btn-raised btn-primary\" ngbButtonLabel>\r\n                                <input type=\"checkbox\" ngbButton [(ngModel)]=\"model.left\"> Left (pre-checked)\r\n                            </label>\r\n                            <label class=\"btn-raised btn-primary\" ngbButtonLabel>\r\n                                <input type=\"checkbox\" ngbButton [(ngModel)]=\"model.middle\"> Middle\r\n                            </label>\r\n                            <label class=\"btn-raised btn-primary\" ngbButtonLabel>\r\n                                <input type=\"checkbox\" ngbButton [(ngModel)]=\"model.right\"> Right\r\n                            </label>\r\n                        </div>\r\n                        <hr>\r\n                        <p>{{model | json}}</p>\r\n                    </div>\r\n                </div>\r\n            </div>\r\n        </div>\r\n        <!--Checkbox ng-buttons Ends-->\r\n\r\n        <!--Checkbox Reactive buttons Starts-->\r\n        <div class=\"col-md-12 col-lg-6\">\r\n            <div class=\"card\">\r\n                <div class=\"card-header\">\r\n                    <h4 class=\"card-title\">Checkbox buttons (Reactive Forms)</h4>\r\n                    <p>A value of a checked button is bound to a variable specified via ngModel.</p>\r\n                </div>\r\n                <div class=\"card-content\">\r\n                    <div class=\"card-body\">\r\n                        <form [formGroup]=\"checkboxGroupForm\">\r\n                            <div class=\"btn-group btn-group-toggle\">\r\n                                <label class=\"btn-raised btn-primary\" ngbButtonLabel>\r\n                                    <input type=\"checkbox\" formControlName=\"left\" ngbButton> Left (pre-checked)\r\n                                </label>\r\n                                <label class=\"btn-raised btn-primary\" ngbButtonLabel>\r\n                                    <input type=\"checkbox\" formControlName=\"middle\" ngbButton> Middle\r\n                                </label>\r\n                                <label class=\"btn-raised btn-primary\" ngbButtonLabel>\r\n                                    <input type=\"checkbox\" formControlName=\"right\" ngbButton> Right\r\n                                </label>\r\n                            </div>\r\n                        </form>\r\n                        <hr>\r\n                        <p>{{checkboxGroupForm.value | json}}</p>\r\n                    </div>\r\n                </div>\r\n            </div>\r\n        </div>\r\n        <!--Checkbox Reactive buttons Ends-->\r\n    </div>\r\n    <div class=\"row text-left\" matchHeight =\"card\">\r\n        <!--Radio buttons Starts-->\r\n        <div class=\"col-md-12 col-lg-6\">\r\n            <div class=\"card\">\r\n                <div class=\"card-header\">\r\n                    <h4 class=\"card-title\">Radio buttons</h4>\r\n                </div>\r\n                <div class=\"card-content\">\r\n                    <div class=\"card-body\">\r\n                        <div class=\"btn-group btn-group-toggle\" ngbRadioGroup name=\"radioBasic\" [(ngModel)]=\"modelRadio\">\r\n                            <label ngbButtonLabel class=\"btn-raised btn-primary\">\r\n                                <input ngbButton type=\"radio\" [value]=\"1\"> Left (pre-checked)\r\n                            </label>\r\n                            <label ngbButtonLabel class=\"btn-raised btn-primary\">\r\n                                <input ngbButton type=\"radio\" value=\"2\"> Middle\r\n                            </label>\r\n                            <label ngbButtonLabel class=\"btn-raised btn-primary\">\r\n                                <input ngbButton type=\"radio\" [value]=\"3\"> Right\r\n                            </label>\r\n                        </div>\r\n                        <hr>\r\n                        <p>{{modelRadio}}</p>\r\n                    </div>\r\n                </div>\r\n            </div>\r\n        </div>\r\n        <!--Radio buttons Ends-->\r\n\r\n        <!--Radio Reactive buttons Starts-->\r\n        <div class=\"col-md-12 col-lg-6\">\r\n            <div class=\"card\">\r\n                <div class=\"card-header\">\r\n                    <h4 class=\"card-title\">Radio buttons (Reactive Forms)</h4>\r\n                    <p>A value of a checked button is bound to a variable specified via ngModel.</p>\r\n                </div>\r\n                <div class=\"card-content\">\r\n                    <div class=\"card-body\">\r\n                        <form [formGroup]=\"radioGroupForm\">\r\n                            <div class=\"btn-group btn-group-toggle\" ngbRadioGroup name=\"radioBasic\" formControlName=\"modelRadioForm\">\r\n                                <label ngbButtonLabel class=\"btn-raised btn-primary\">\r\n                                <input ngbButton type=\"radio\" value=\"Left\"> Left (pre-checked)\r\n                                </label>\r\n                                <label ngbButtonLabel class=\"btn-raised btn-primary\">\r\n                                <input ngbButton type=\"radio\" value=\"Middle\"> Middle\r\n                                </label>\r\n                                <label ngbButtonLabel class=\"btn-raised btn-primary\">\r\n                                <input ngbButton type=\"radio\" value=\"Right\"> Right\r\n                                </label>\r\n                            </div>\r\n                        </form>\r\n                        <hr>\r\n                        <p>{{radioGroupForm.value['modelRadioForm']}}</p>\r\n                    </div>\r\n                </div>\r\n            </div>\r\n        </div>\r\n        <!--Radio Reactive buttons Ends-->\r\n    </div>\r\n</section>"

