module.exports = "<!--Basic Pagination Starts-->\r\n<section id=\"basic-pagination\">\r\n    <div class=\"row text-left\">\r\n        <div class=\"col-sm-12\">\r\n            <div class=\"content-header\">Pagination</div>\r\n            <p class=\"content-sub-header\">Provide pagination links for your site or app with the multi-page pagination component, or the simpler pager alternative.</p>\r\n        </div>\r\n    </div>\r\n    <div class=\"row text-left\" matchHeight =\"card\">\r\n        <!--Basic Pagination Starts-->\r\n        <div class=\"col-xl-6 col-lg-12\">\r\n            <div class=\"card\">\r\n                <div class=\"card-header\">\r\n                    <h4 class=\"card-title\">Basic Pagination</h4>\r\n                </div>\r\n                <div class=\"card-content\">\r\n                    <div class=\"card-body\">\r\n                        <h5 class=\"mb-2 mt-4 text-bold-400\">Default pagination</h5>\r\n                        <ngb-pagination [collectionSize]=\"70\" [(page)]=\"page\"></ngb-pagination>\r\n                        <h5 class=\"mb-2 mt-4 text-bold-400\">directionLinks = false</h5>\r\n                        <ngb-pagination [collectionSize]=\"70\" [(page)]=\"page1\" [directionLinks]=\"false\"></ngb-pagination>\r\n                        <h5 class=\"mb-2 mt-4 text-bold-400\">boundaryLinks = true</h5>\r\n                        <ngb-pagination [collectionSize]=\"70\" [(page)]=\"page2\" [boundaryLinks]=\"true\"></ngb-pagination>\r\n                        <hr>\r\n                        <p>Current page: {{page2}}</p>\r\n                    </div>\r\n                </div>\r\n            </div>\r\n        </div>\r\n        <!--Basic Pagination Ends-->\r\n\r\n        <!--Advanced Pagination Starts-->\r\n        <div class=\"col-xl-6 col-lg-12\">\r\n            <div class=\"card\">\r\n                <div class=\"card-header\">\r\n                    <h4 class=\"card-title\">Advanced Pagination</h4>\r\n                </div>\r\n                <div class=\"card-content\">\r\n                    <div class=\"card-body\">\r\n                        <h5 class=\"mb-2 mt-4 text-bold-400\">maxSize = 5, rotate = false</h5>\r\n                        <ngb-pagination [collectionSize]=\"120\" [(page)]=\"page3\" [maxSize]=\"5\" [boundaryLinks]=\"true\"></ngb-pagination>\r\n                        <h5 class=\"mb-2 mt-4 text-bold-400\">maxSize = 5, rotate = true</h5>\r\n                        <ngb-pagination [collectionSize]=\"120\" [(page)]=\"page4\" [maxSize]=\"5\" [rotate]=\"true\" [boundaryLinks]=\"true\"></ngb-pagination>\r\n                        <h5 class=\"mb-2 mt-4 text-bold-400\">maxSize = 5, rotate = true, ellipses = false</h5>\r\n                        <ngb-pagination [collectionSize]=\"120\" [(page)]=\"page5\" [maxSize]=\"5\" [rotate]=\"true\" [ellipses]=\"false\" [boundaryLinks]=\"true\"></ngb-pagination>\r\n                        <hr>\r\n                        <p>Current page: {{page5}}</p>\r\n                    </div>\r\n                </div>\r\n            </div>\r\n        </div>\r\n        <!--Advanced Pagination Ends-->\r\n    </div>\r\n</section>\r\n<section id=\"pagination-option\">\r\n    <div class=\"row text-left\" matchHeight =\"card\">\r\n        <!--Pagination Sizes Starts-->\r\n        <div class=\"col-xl-6 col-lg-12\">\r\n            <div class=\"card\">\r\n                <div class=\"card-header\">\r\n                    <h4 class=\"card-title\">Pagination Sizes</h4>\r\n                </div>\r\n                <div class=\"card-content\">\r\n                    <div class=\"card-body\">\r\n                        <h5 class=\"mb-2 mt-4 text-bold-400\">Large Pagination</h5>\r\n                        <ngb-pagination [collectionSize]=\"30\" [(page)]=\"currentPage\" size=\"lg\"></ngb-pagination>\r\n                        <h5 class=\"mb-2 mt-4 text-bold-400\">Default Pagination</h5>\r\n                        <ngb-pagination [collectionSize]=\"30\" [(page)]=\"currentPage1\"></ngb-pagination>\r\n                        <h5 class=\"mb-2 mt-4 text-bold-400\">Small Pagination</h5>\r\n                        <ngb-pagination [collectionSize]=\"30\" [(page)]=\"currentPage2\" size=\"sm\"></ngb-pagination>\r\n                    </div>\r\n                </div>\r\n            </div>\r\n        </div>\r\n        <!--Pagination Sizes Ends-->\r\n\r\n        <!--Pagination Options Starts-->\r\n        <div class=\"col-xl-6 col-lg-12\">\r\n            <div class=\"card\">\r\n                <div class=\"card-header\">\r\n                    <h4 class=\"card-title\">Pagination Options</h4>\r\n                </div>\r\n                <div class=\"card-content\">\r\n                    <div class=\"card-body\">\r\n                        <h5 class=\"mb-2 mt-4 text-bold-400\">Pagination control can be disabled</h5>\r\n                        <ngb-pagination [collectionSize]=\"70\" [(page)]=\"page6\" [disabled]='isDisabled'></ngb-pagination>\r\n                        <button class=\"btn btn-sm btn-outline-primary\" (click)=\"toggleDisabled()\">\r\n                            Toggle disabled\r\n                        </button>\r\n                        \r\n                        <h5 class=\"mb-2 mt-4 text-bold-400\">This pagination uses custom default values</h5>\r\n                        <ngb-pagination [collectionSize]=\"70\" [(page)]=\"page7\"></ngb-pagination>\r\n                    </div>\r\n                </div>\r\n            </div>\r\n        </div>\r\n        <!--Pagination Options Ends-->\r\n    </div>\r\n</section>\r\n<!--Basic Pagination Ends-->"

