module.exports = "<!--Tooltip Starts-->\r\n<section id=\"tooltio\">\r\n  <div class=\"row text-left\">\r\n    <div class=\"col-sm-12\">\r\n      <div class=\"content-header\">Tooltips</div>\r\n    </div>\r\n  </div>\r\n  <div class=\"row text-left\">\r\n    <!--Quick and easy tooltips Starts-->\r\n    <div class=\"col-md-12 col-lg-12\">\r\n      <div class=\"card\">\r\n        <div class=\"card-header\">\r\n          <h4 class=\"card-title\">Quick and easy tooltips</h4>\r\n        </div>\r\n        <div class=\"card-content\">\r\n          <div class=\"card-body\">\r\n            <button type=\"button\" class=\"btn btn-outline-primary mr-1 mb-1\" placement=\"top\" ngbTooltip=\"Tooltip on top\">\r\n              Tooltip on top\r\n            </button>\r\n            <button type=\"button\" class=\"btn btn-outline-warning mr-1 mb-1\" placement=\"right\" ngbTooltip=\"Tooltip on right\">\r\n              Tooltip on right\r\n            </button>\r\n            <button type=\"button\" class=\"btn btn-outline-success mr-1 mb-1\" placement=\"bottom\" ngbTooltip=\"Tooltip on bottom\">\r\n              Tooltip on bottom\r\n            </button>\r\n            <button type=\"button\" class=\"btn btn-outline-danger mr-1 mb-1\" placement=\"left\" ngbTooltip=\"Tooltip on left\">\r\n              Tooltip on left\r\n            </button>\r\n          </div>\r\n        </div>\r\n      </div>\r\n    </div>\r\n    <!--Quick and easy tooltips Ends-->\r\n  </div>\r\n  <div class=\"row text-left\">\r\n    <!--HTML and bindings in tooltips Starts-->\r\n    <div class=\"col-md-12 col-lg-12\">\r\n      <div class=\"card\">\r\n        <div class=\"card-header\">\r\n          <h4 class=\"card-title\">HTML and bindings in tooltips</h4>\r\n        </div>\r\n        <div class=\"card-content\">\r\n          <div class=\"card-body\">\r\n            <p>Tooltips can contain any arbitrary HTML, Angular bindings and even directives! Simply enclose desired\r\n              content in\r\n              a <code>&lt;template&gt;</code> element.</p>\r\n\r\n            <ng-template #tipContent>Hello, <b>{{name}}</b>!</ng-template>\r\n            <button type=\"button\" class=\"btn btn-outline-primary\" [ngbTooltip]=\"tipContent\">\r\n              I've got markup and bindings in my tooltip!\r\n            </button>\r\n          </div>\r\n        </div>\r\n      </div>\r\n    </div>\r\n    <!--HTML and bindings in tooltips Ends-->\r\n  </div>\r\n  <div class=\"row text-left\">\r\n    <!--Custom and manual triggers Starts-->\r\n    <div class=\"col-md-12 col-lg-12\">\r\n      <div class=\"card\">\r\n        <div class=\"card-header\">\r\n          <h4 class=\"card-title\">Custom and manual triggers</h4>\r\n          <p> You can easily override open and close triggers by specifying event names (separated by <code>:</code>)\r\n            in the <code>triggers</code> property.</p>\r\n        </div>\r\n        <div class=\"card-content\">\r\n          <div class=\"card-body\">\r\n            <button type=\"button\" class=\"btn btn-outline-success\" ngbTooltip=\"You see, I show up on click!\" triggers=\"click:blur\">\r\n              Click me!\r\n            </button>\r\n\r\n            <p class=\"pt-3\">\r\n              Alternatively you can take full manual control over tooltip opening / closing events.\r\n            </p>\r\n\r\n            <button type=\"button\" class=\"btn btn-outline-info mr-1\" ngbTooltip=\"What a great tip!\" triggers=\"manual\" #t=\"ngbTooltip\"\r\n              (click)=\"t.open()\">\r\n              Click me to open a tooltip\r\n            </button>\r\n            <button type=\"button\" class=\"btn btn-outline-warning\" (click)=\"t.close()\">\r\n              Click me to close a tooltip\r\n            </button>\r\n          </div>\r\n        </div>\r\n      </div>\r\n    </div>\r\n    <!--Custom and manual triggers Ends-->\r\n  </div>\r\n  <div class=\"row text-left\">\r\n    <!--Context and manual triggers Starts-->\r\n    <div class=\"col-md-12 col-lg-12\">\r\n      <div class=\"card\">\r\n        <div class=\"card-header\">\r\n          <h4 class=\"card-title\">Context and manual triggers</h4>\r\n          <p> You can optionally pass in a context when manually triggering a popover.</p>\r\n        </div>\r\n        <div class=\"card-content\">\r\n          <div class=\"card-body\">\r\n            <ng-template #tipContent let-greeting=\"greeting\">{{greeting}}, <b>{{name}}</b>!</ng-template>\r\n            <p>\r\n              How would you like to greet <strong [ngbTooltip]=\"tipContent\" #x=\"ngbTooltip\" triggers=\"manual\">me</strong>?\r\n            </p>\r\n            <button type=\"button\" class=\"btn btn-outline-primary mr-1\" (click)=\"changeGreeting({ greeting: 'Bonjour' })\">\r\n              French\r\n            </button>\r\n            <button type=\"button\" class=\"btn btn-outline-warning mr-1\" (click)=\"changeGreeting({ greeting: 'Gutentag' })\">\r\n              German\r\n            </button>\r\n            <button type=\"button\" class=\"btn btn-outline-info\" (click)=\"changeGreeting({ greeting: 'Hello' })\">\r\n              English\r\n            </button>\r\n          </div>\r\n        </div>\r\n      </div>\r\n    </div>\r\n    <!--Context and manual triggers Ends-->\r\n  </div>\r\n  <div class=\"row text-left\">\r\n    <!--Append tooltip in the body Starts-->\r\n    <div class=\"col-md-12 col-lg-12\">\r\n      <div class=\"card\">\r\n        <div class=\"card-header\">\r\n          <h4 class=\"card-title\">Append tooltip in the body</h4>\r\n          <p>Set the <code>container</code> property to \"body\" to have the tooltip be appended to the body instead of\r\n            the triggering\r\n            element's parent. This option is useful if the element triggering the tooltip is inside an element that\r\n            clips its\r\n            contents (i.e. <code>overflow: hidden</code>).</p>\r\n        </div>\r\n        <div class=\"card-content\">\r\n          <div class=\"card-body\" style=\"padding: 50px 0; text-align: center; overflow:hidden\">\r\n            <button type=\"button\" class=\"btn btn-outline-success mr-1\" ngbTooltip=\"Vivamus sagittis lacus vel augue laoreet rutrum faucibus.\">\r\n              Default tooltip\r\n            </button>\r\n            <button type=\"button\" class=\"btn btn-outline-danger\" ngbTooltip=\"Vivamus sagittis lacus vel augue laoreet rutrum faucibus.\"\r\n              container=\"body\">\r\n              Tooltip appended to body\r\n            </button>\r\n          </div>\r\n        </div>\r\n      </div>\r\n    </div>\r\n    <!--Append tooltip in the body Ends-->\r\n  </div>\r\n</section>\r\n<!--Tooltip Ends-->\r\n"

