module.exports = "<!--NoUI Slider Starts-->\r\n<section id=\"slider-values\">\r\n    <div class=\"row text-left\">\r\n        <div class=\"col-sm-12\">\r\n            <div class=\"content-header\">NoUI Slider</div>\r\n        </div>\r\n    </div>\r\n    <div class=\"row text-left\">\r\n        <!--Single Value NoUI Slider Starts-->\r\n        <div class=\"col-sm-12 col-md-6\">\r\n            <div class=\"card\">\r\n                <div class=\"card-header\">\r\n                    <h4 class=\"card-title\">Single Value</h4>\r\n                </div>\r\n                <div class=\"card-content\">\r\n                    <div class=\"card-body text-center\">\r\n                        <div class=\"form-group\">\r\n                            <nouislider [min]=\"someMin\" [max]=\"someMax\" [step]=\"0.05\" [(ngModel)]=\"someValue\"  [disabled]=\"disabled\"></nouislider>\r\n                        </div>\r\n                    </div>\r\n                </div>\r\n            </div>\r\n        </div>\r\n        <!--Single Value NoUI Slider Ends-->\r\n        \r\n        <!--Single Value NoUI Slider in form Starts-->\r\n        <div class=\"col-sm-12 col-md-6\">\r\n            <div class=\"card\">\r\n                <div class=\"card-header\">\r\n                    <h4 class=\"card-title\">Single value (in &lt;form&gt;)</h4>\r\n                </div>\r\n                <div class=\"card-content\">\r\n                    <div class=\"card-body text-center\">\r\n                        <div class=\"form-group\">\r\n                            <form [formGroup]=\"form1\">\r\n                                <nouislider [min]=\"0\" [max]=\"20\" [step]=\"0.5\" [formControl]=\"form1.controls.single\"></nouislider>\r\n                            </form>\r\n                        </div>\r\n                    </div>\r\n                </div>\r\n            </div>\r\n        </div>\r\n        <!--Single Value NoUI Slider in form Ends-->\r\n\r\n        <!--Range NoUI Slider Starts-->\r\n        <div class=\"col-sm-12 col-md-6\">\r\n            <div class=\"card\">\r\n                <div class=\"card-header\">\r\n                    <h4 class=\"card-title\">Range</h4>\r\n                </div>\r\n                <div class=\"card-content\">\r\n                    <div class=\"card-body text-center\">\r\n                        <div class=\"form-group\">\r\n                            <nouislider [connect]=\"true\" [min]=\"0\" [max]=\"15\" [step]=\"1\" [(ngModel)]=\"someRange\"></nouislider>\r\n\r\n                        </div>\r\n                    </div>\r\n                </div>\r\n            </div>\r\n        </div>   \r\n        <!--Range NoUI Slider Ends-->\r\n\r\n        <!--Range NoUI Slider in form Starts-->\r\n        <div class=\"col-sm-12 col-md-6\">\r\n            <div class=\"card\">\r\n                <div class=\"card-header\">\r\n                    <h4 class=\"card-title\">Range (in &lt;form&gt;)</h4>\r\n                </div>\r\n                <div class=\"card-content\">\r\n                    <div class=\"card-body text-center\">\r\n                        <div class=\"form-group\">\r\n                            <form [formGroup]=\"form2\">\r\n                                <nouislider [connect]=\"true\" [min]=\"0\" [max]=\"10\" [step]=\"1\" [formControl]=\"form2.controls.range\"></nouislider>\r\n                            </form>\r\n                        </div>\r\n                    </div>\r\n                </div>\r\n            </div>\r\n        </div>\r\n        <!--Range NoUI Slider in form Ends-->\r\n\r\n        <!--Range NoUI Slider with config Starts-->\r\n        <div class=\"col-sm-12 col-md-6\">\r\n            <div class=\"card\">\r\n                <div class=\"card-header\">\r\n                    <h4 class=\"card-title\">Range with config</h4>\r\n                </div>\r\n                <div class=\"card-content\">\r\n                    <div class=\"card-body text-center mb-3\">\r\n                        <div class=\"form-group\">\r\n                            <nouislider [config]=\"someRange2config\" [limit]=\"10\" [(ngModel)]=\"someRange2\"></nouislider>\r\n                        </div>\r\n                    </div>\r\n                </div>\r\n            </div>\r\n        </div>\r\n        <!--Range NoUI Slider with config Ends-->\r\n\r\n        <!--Keyboard support Starts-->\r\n        <div class=\"col-sm-12 col-md-6\">\r\n            <div class=\"card\">\r\n                <div class=\"card-header\">\r\n                    <h4 class=\"card-title\">Keyboard support</h4>\r\n                </div>\r\n                <div class=\"card-content\">\r\n                    <div class=\"card-body text-center mb-3\">\r\n                        <div class=\"form-group\">\r\n                            <nouislider [config]=\"someKeyboardConfig\" [(ngModel)]=\"someKeyboard\"></nouislider>\r\n                        </div>\r\n                    </div>\r\n                </div>\r\n            </div>\r\n        </div>\r\n        <!--Keyboard support Ends-->\r\n\r\n        <!--With Custom Key Handler Starts-->\r\n        <div class=\"col-sm-12 col-md-6\">\r\n            <div class=\"card\">\r\n                <div class=\"card-header\">\r\n                    <h4 class=\"card-title\">With Custom Key Handler</h4>\r\n                </div>\r\n                <div class=\"card-content\">\r\n                    <div class=\"card-body text-center mb-3\">\r\n                        <div class=\"form-group\">\r\n                            <nouislider [config]=\"someKeyboardConfig2\" [(ngModel)]=\"someKeyboard2\"></nouislider>\r\n                        </div>\r\n                    </div>\r\n                </div>\r\n            </div>\r\n        </div>\r\n        <!--With Custom Key Handler Ends-->\r\n\r\n        <!--NoUI Slider with Tooltip Starts-->\r\n        <div class=\"col-sm-12 col-md-6\">\r\n            <div class=\"card\">\r\n                <div class=\"card-header\">\r\n                    <h4 class=\"card-title\">Tooltips</h4>\r\n                </div>\r\n                <div class=\"card-content\">\r\n                    <div class=\"card-body text-center\">\r\n                        <div class=\"form-group\">\r\n                            <nouislider [min]=\"0\" [max]=\"10\" [step]=\"0.05\" [(ngModel)]=\"someRange3\" [tooltips]=\"[ false, true ]\" style=\"margin-top: 4em;\"></nouislider>\r\n                        </div>\r\n                    </div>\r\n                </div>\r\n            </div>\r\n        </div>\r\n        <!--NoUI Slider with Tooltip Ends-->\r\n\r\n        <!--NoUI Slider with Tooltip custom formatting Starts-->\r\n        <div class=\"col-sm-12 col-md-6\">\r\n            <div class=\"card\">\r\n                <div class=\"card-header\">\r\n                    <h4 class=\"card-title\">With custom formatting</h4>\r\n                </div>\r\n                <div class=\"card-content\">\r\n                    <div class=\"card-body text-center\">\r\n                        <div class=\"form-group\">\r\n                            <nouislider [config]=\"someTimeConfig\" [(ngModel)]=\"someTime\" style=\"margin-bottom: 5rem\"></nouislider>\r\n                        </div>\r\n                    </div>\r\n                </div>\r\n            </div>\r\n        </div>\r\n        <!--NoUI Slider with Tooltip custom formatting Ends-->\r\n    </div>\r\n</section>\r\n<!-- // Slider values section end -->"

