module.exports = "<section id=\"switch\">\r\n  <div class=\"row text-left\">\r\n    <div class=\"col-sm-12\">\r\n      <div class=\"content-header\">Angular ng-select</div>\r\n      <p class=\"content-sub-header\"></p>\r\n    </div>\r\n  </div>\r\n  <div class=\"row text-left\">\r\n    <div class=\"col-xl-6 col-lg-6 col-12\">\r\n      <div class=\"card\">\r\n        <div class=\"card-header\">\r\n          <h4>Basic</h4>\r\n        </div>\r\n        <div class=\"card-body\">\r\n          <div>\r\n            <ng-select [items]=\"cities\" bindLabel=\"name\" placeholder=\"Select city\" [(ngModel)]=\"selectedCity\">\r\n            </ng-select>\r\n            <p>\r\n              Selected city: {{selectedCity | json}}\r\n            </p>\r\n          </div>\r\n        </div>\r\n      </div>\r\n    </div>\r\n    <div class=\"col-xl-6 col-lg-6 col-12\">\r\n      <div class=\"card\">\r\n        <div class=\"card-header\">\r\n          <h4>Multiselect with custom bindings</h4>\r\n        </div>\r\n        <div class=\"card-body\">\r\n          <div>\r\n            <ng-select [items]=\"cities2\" bindLabel=\"name\" bindValue=\"id\" [multiple]=\"true\" placeholder=\"Select cities\"\r\n              [(ngModel)]=\"selectedCityIds\">\r\n            </ng-select>\r\n            <p>\r\n              Selected cities: {{selectedCityIds}}\r\n            </p>\r\n          </div>\r\n        </div>\r\n      </div>\r\n    </div>\r\n  </div>\r\n  <div class=\"row text-left\">\r\n    <div class=\"col-xl-6 col-lg-6 col-12\">\r\n      <div class=\"card\">\r\n        <div class=\"card-header\">\r\n          <h4>Custom tags</h4>\r\n        </div>\r\n        <div class=\"card-body\">\r\n          <div>\r\n            <ng-select [items]=\"users\" bindLabel=\"name\" bindValue=\"id\" [addTag]=\"addCustomUser\" [multiple]=\"true\"\r\n              placeholder=\"Select user or add custom tag\" [(ngModel)]=\"selectedUserIds\">\r\n            </ng-select>\r\n            <p>\r\n              Selected user: {{selectedUserIds}}\r\n            </p>\r\n          </div>\r\n        </div>\r\n      </div>\r\n    </div>\r\n    <div class=\"col-xl-6 col-lg-6 col-12\">\r\n      <div class=\"card\">\r\n        <div class=\"card-header\">\r\n          <h4>Custom templates</h4>\r\n        </div>\r\n        <div class=\"card-body\">\r\n          <div>\r\n            <ng-select [items]=\"cities3\" bindLabel=\"name\" bindValue=\"name\" placeholder=\"Select city\" [(ngModel)]=\"selectedCityName\">\r\n              <ng-template ng-header-tmp>\r\n                Custom header\r\n              </ng-template>\r\n              <ng-template ng-label-tmp let-item=\"item\">\r\n                <img height=\"15\" width=\"15\" [src]=\"item.avatar\" />\r\n                <b>{{item.name}}</b> is cool\r\n              </ng-template>\r\n              <ng-template ng-option-tmp let-item=\"item\" let-index=\"index\">\r\n                <img height=\"15\" width=\"15\" [src]=\"item.avatar\" />\r\n                <b>{{item.name}}</b>\r\n              </ng-template>\r\n              <ng-template ng-footer-tmp>\r\n                Custom footer\r\n              </ng-template>\r\n            </ng-select>\r\n            <p>\r\n              Selected city: {{selectedCityName}}\r\n            </p>\r\n          </div>\r\n        </div>\r\n      </div>\r\n    </div>\r\n  </div>\r\n  <div class=\"row text-left\">\r\n    <div class=\"col-xl-6 col-lg-6 col-12\">\r\n      <div class=\"card\">\r\n        <div class=\"card-header\">\r\n          <h4>Virtual scroll</h4>\r\n        </div>\r\n        <div class=\"card-body\">\r\n          <div>\r\n            <ng-select [items]=\"cities4\" [virtualScroll]=\"true\" bindLabel=\"name\" bindValue=\"id\" placeholder=\"Select city\"\r\n              [(ngModel)]=\"selectedCityId\">\r\n            </ng-select>\r\n            <p>\r\n              Selected city ID: {{selectedCityId}}\r\n            </p>\r\n          </div>\r\n        </div>\r\n      </div>\r\n    </div>\r\n    <div class=\"col-xl-6 col-lg-6 col-12\">\r\n      <div class=\"card\">\r\n        <div class=\"card-header\">\r\n          <h4>Append dropdown to body</h4>\r\n        </div>\r\n        <div class=\"card-body\">\r\n          <div>\r\n            <ng-select [items]=\"cities4\" bindLabel=\"name\" [virtualScroll]=\"true\" bindValue=\"id\" appendTo=\"body\"\r\n              placeholder=\"Select city\" [(ngModel)]=\"selectedCityId\">\r\n            </ng-select>\r\n            <p>\r\n              Selected city ID: {{selectedCityId}}\r\n            </p>\r\n          </div>\r\n        </div>\r\n      </div>\r\n    </div>\r\n  </div>\r\n  <div class=\"row text-left\">\r\n    <div class=\"col-xl-6 col-lg-6 col-12\">\r\n      <div class=\"card\">\r\n        <div class=\"card-header\">\r\n          <h4>Grouping</h4>\r\n        </div>\r\n        <div class=\"card-body\">\r\n          <div>\r\n            <ng-select [items]=\"accounts\" bindLabel=\"name\" bindValue=\"name\" groupBy=\"country\" [(ngModel)]=\"selectedAccount\">\r\n            </ng-select>\r\n          </div>\r\n        </div>\r\n      </div>\r\n    </div>\r\n    <div class=\"col-xl-6 col-lg-6 col-12\">\r\n\r\n    </div>\r\n\r\n  </div>\r\n\r\n</section>"

