module.exports = "<section id=\"tags\">\r\n  <div class=\"row text-left\">\r\n    <div class=\"col-12 mt-3 mb-1\">\r\n      <div class=\"content-header\">Input Tags</div>\r\n      <p class=\"content-sub-header\"></p>\r\n    </div>\r\n  </div>\r\n  <div class=\"row text-left\">\r\n    <div class=\"col-xl-4 col-lg-4 col-12\">\r\n      <div class=\"card\">\r\n        <div class=\"card-header\">\r\n          <h4>Simple Input with two items</h4>\r\n        </div>\r\n        <div class=\"card-body\">\r\n          <div>\r\n            <tag-input [(ngModel)]=\"items\" (onSelect)=\"onSelect($event)\" [modelAsStrings]=\"true\">\r\n            </tag-input>\r\n          </div>\r\n        </div>\r\n      </div>\r\n    </div>\r\n    <div class=\"col-xl-4 col-lg-4 col-12\">\r\n      <div class=\"card\">\r\n        <div class=\"card-header\">\r\n          <h4>Simple Input with not removable items</h4>\r\n        </div>\r\n        <div class=\"card-body\">\r\n          <div>\r\n            <tag-input [ngModel]=\"items1\" [removable]=\"false\"></tag-input>\r\n          </div>\r\n        </div>\r\n      </div>\r\n    </div>\r\n    <div class=\"col-xl-4 col-lg-4 col-12\">\r\n      <div class=\"card\">\r\n        <div class=\"card-header\">\r\n          <h4>Simple Input with editable items</h4>\r\n        </div>\r\n        <div class=\"card-body\">\r\n          <div>\r\n            <tag-input [(ngModel)]=\"items2\" [editable]=\"true\" (onTagEdited)=\"onTagEdited($event)\">\r\n            </tag-input>\r\n          </div>\r\n        </div>\r\n      </div>\r\n    </div>\r\n  </div>\r\n  <div class=\"row text-left\">\r\n    <div class=\"col-xl-4 col-lg-4 col-12\">\r\n      <div class=\"card\">\r\n        <div class=\"card-header\">\r\n          <h4>An input which requires all tags to start with '@' and end with '$'</h4>\r\n        </div>\r\n        <div class=\"card-body\">\r\n          <div>\r\n            <tag-input [ngModel]=\"['@item']\" [errorMessages]=\"errorMessages\" [validators]=\"validators\">\r\n            </tag-input>\r\n          </div>\r\n        </div>\r\n      </div>\r\n    </div>\r\n    <div class=\"col-xl-4 col-lg-4 col-12\">\r\n      <div class=\"card\">\r\n        <div class=\"card-header\">\r\n          <h4>An input which will transform the value of all added tags prepending '@' to the tag</h4>\r\n        </div>\r\n        <div class=\"card-body\">\r\n          <div>\r\n            <tag-input [ngModel]=\"['@item']\" [onAdding]=\"transform\">\r\n            </tag-input>\r\n          </div>\r\n        </div>\r\n      </div>\r\n    </div>\r\n    <div class=\"col-xl-4 col-lg-4 col-12\">\r\n      <div class=\"card\">\r\n        <div class=\"card-header\">\r\n          <h4>Tags accepting only items from an autocomplete</h4>\r\n        </div>\r\n        <div class=\"card-body\">\r\n          <div>\r\n            <tag-input [ngModel]=\"['@item']\" [onlyFromAutocomplete]=\"true\">\r\n              <tag-input-dropdown [showDropdownIfEmpty]=\"true\" [focusFirstElement]=\"true\" [displayBy]=\"'value'\" [identifyBy]=\"'id'\" [autocompleteItems]=\"autocompleteItemsAsObjects\">\r\n                <ng-template let-item=\"item\" let-index=\"index\">\r\n                  ({{ index }}) {{ item.id }}: {{ item.value }}\r\n                </ng-template>\r\n              </tag-input-dropdown>\r\n            </tag-input>\r\n          </div>\r\n        </div>\r\n      </div>\r\n    </div>\r\n  </div>\r\n  <div class=\"row text-left\">\r\n    <div class=\"col-xl-4 col-lg-4 col-12\">\r\n      <div class=\"card\">\r\n        <div class=\"card-header\">\r\n          <h4>Tags dropdown with last provided</h4>\r\n        </div>\r\n        <div class=\"card-body\">\r\n          <div>\r\n            <tag-input [ngModel]=\"[]\" [placeholder]=\"'Enter a new repo'\" [secondaryPlaceholder]=\"'Search in Github'\" [onlyFromAutocomplete]=\"true\">\r\n              <tag-input-dropdown [autocompleteObservable]=\"requestAutocompleteItems\">\r\n                <ng-template let-item=\"item\" let-index=\"index\" let-last=\"last\">\r\n                  ({{ index }}) {{ item.id }}: {{ item.value }} # {{ last }}\r\n                </ng-template>\r\n              </tag-input-dropdown>\r\n            </tag-input>\r\n          </div>\r\n        </div>\r\n      </div>\r\n    </div>\r\n    <div class=\"col-xl-4 col-lg-4 col-12\">\r\n      <div class=\"card\">\r\n        <div class=\"card-header\">\r\n          <h4>An input which allows adding items by pressing the key \"space\" of your keyboard</h4>\r\n        </div>\r\n        <div class=\"card-body\">\r\n          <div>\r\n            <tag-input [ngModel]=\"['@item']\" [inputClass]=\"'myinput'\" [inputId]=\"'myinputId'\" [separatorKeyCodes]=\"[32, 188]\">\r\n            </tag-input>\r\n          </div>\r\n        </div>\r\n      </div>\r\n    </div>\r\n    <div class=\"col-xl-4 col-lg-4 col-12\">\r\n      <div class=\"card\">\r\n        <div class=\"card-header\">\r\n          <h4>Tags with Bootstrap theme</h4>\r\n        </div>\r\n        <div class=\"card-body\">\r\n          <div>\r\n            <tag-input [theme]=\"'bootstrap'\" [ngModel]=\"['@item']\" name=\"items\">\r\n            </tag-input>\r\n          </div>\r\n        </div>\r\n      </div>\r\n    </div>\r\n  </div>\r\n  <div class=\"row text-left\">\r\n    <div class=\"col-xl-4 col-lg-4 col-12\">\r\n      <div class=\"card\">\r\n        <div class=\"card-header\">\r\n          <h4>Disabled tag input</h4>\r\n        </div>\r\n        <div class=\"card-body\">\r\n          <div>\r\n            Disable:\r\n            <input type=\"checkbox\" [(ngModel)]=\"disabled\" />\r\n\r\n            <tag-input [ngModel]=\"items3\" [disabled]=\"disabled\">\r\n            </tag-input>\r\n          </div>\r\n        </div>\r\n      </div>\r\n    </div>\r\n    <div class=\"col-xl-4 col-lg-4 col-12\">\r\n      <div class=\"card\">\r\n        <div class=\"card-header\">\r\n          <h4>Drag and drop</h4>\r\n        </div>\r\n        <div class=\"card-body\">\r\n          <div>\r\n            <tag-input [(ngModel)]=\"dragAndDropExample\" [modelAsStrings]=\"true\" [dragZone]=\"'zone1'\" [editable]=\"true\">\r\n            </tag-input>\r\n          </div>\r\n        </div>\r\n      </div>\r\n    </div>\r\n    <div class=\"col-xl-4 col-lg-4 col-12\">\r\n      <div class=\"card\">\r\n        <div class=\"card-header\">\r\n          <h4>Confirm adding and removing tags with Observables</h4>\r\n        </div>\r\n        <div class=\"card-body\">\r\n          <div>\r\n            <tag-input [ngModel]=\"['item1']\" [dragZone]=\"'zone1'\" [modelAsStrings]=\"true\" [onRemoving]=\"onRemoving\" [onAdding]=\"onAdding\">\r\n            </tag-input>\r\n          </div>\r\n        </div>\r\n      </div>\r\n    </div>\r\n  </div>\r\n</section>"

